import React from 'react';
import { Link } from 'react-router-dom';
const Header = () => {
    return (
        <header>
            <img src="images/logo.png" alt="webinjaz io"/> 
            <div>
                <Link to="/build">Build Tool</Link>
                <a href="https://webinjaz.gitbook.io/framework">Docs</a>
            </div>
        </header>
    )
}

export default Header;
